import React from 'react';
import Train from '../components/Train';
import trainData from '../server/trainData';
import "./TrainList.css";

const info = trainData.RailArrivals;

export default function TrainList(props) {
    const { color } = props;
    const lineTrains = info.filter((train) => train.LINE === color);
    console.log(lineTrains);

    return (
        <div className="allTrains">
            {info.map((train) => {
                if (info.LINE === color) {
                    <Train trainData={train}/>
                }
            })}
        </div>
    )
}
